@import './variables';

* {
    margin: 0px;
    padding: 0px;
    box-sizing: border-box;
}

html {
    scroll-behavior: smooth;
}

body{
    font-family: 'Slabo 27px', serif;
    font-size: 14px; 
    @media (min-width: 600px) {font-size: 16px};
    @media (min-width: 900px) {font-size: 18px};
    @media (min-width: 1200px) {font-size: 20px};
    @media (min-width: 1800px) {font-size: 22px};
    background: #000;
    color: $white;
    line-height: 2;
    text-shadow: 1px 1px 2px black;
    text-align: center;
    overflow-x: hidden;
    padding: 1vh;
}

:focus {
    outline: none;
    border: 1px solid $darkGreen;
}

//review and carousel dots
.dot {
    height: 15px;
    width: 15px;
    margin: 0 2px;
    background-color: $green;
    &:nth-child(1) {background-color:$darkGreen};
    border-radius: 50%;
    display: inline-block;
    transition: background-color 0.3s ease;
    cursor: pointer;
}

@import "navbar";
@import "home";
@import "about";
@import "menu";
@import "review";
@import "location";
@import "footer";
@import "modal";

/* 320, 720, 1020 */

sources.styles\\_variables.scss:
$white: #F5F5F5;
$green: #36970F;
$darkGreen: #205909;

$desktop: 720px;
$tablet: 500px;

@mixin flexCenter ($direction) {
    display: flex;
    align-items: center;
    justify-content: center;
    flex-direction: $direction
}

@mixin fontSize {
    font-size: 14px; 
    @media (min-width: 600px) {font-size: 16px};
    @media (min-width: 900px) {font-size: 18px};
    @media (min-width: 1200px) {font-size: 20px};
    @media (min-width: 1800px) {font-size: 22px};
    line-height: 1.2;
}

@mixin media($px) {
    @media (min-width: $px) {
        @content
    }
}

sources.styles\\_navbar.scss:
nav {
    width: 100vw;
    height: 10vh;
    background: black;
    display: flex;
    justify-content: space-between;
    scroll-snap-align: start;
    align-items: center;
    text-decoration: none;
    list-style: none;
    transition: height 1s ease-in-out;
    box-shadow: 3px;
    z-index: 97;
    img {
        z-index: 98;
    }
    .burger {
        cursor: pointer;
        padding: 1vw;
        .line1, .line2, .line3 {
            width: 35px;
            height: 5px;
            background-color: $white;
            margin: 6px 0;
            transition: 0.4s;
          }
        } 
    }
    .nav-links {
        position: absolute;
        top: 10vh;        
        width: 100vw;
        background: black;
        color: $white;
        display: flex;
        flex-direction: column;
        align-items: center;
        justify-content: space-between;
        height: 0vh; 
        transition: height .5s ease-in-out;
        pointer-events: none;
        a {
            opacity: 0;
            text-decoration: none;
            color: $white;   
            &:hover, &:active {
                color: $green;
            }
        }
        #bookBtn {
            font-size: larger;
        }
    }
    .nav-scroll {
        .nav-links a {
            text-decoration: underline $green solid;
        }
    }
   .nav-active {
       .nav-links {
           pointer-events: auto;
           padding-bottom: 1em;
            height: 40vh !important;
            a {
                opacity: 1 !important;
            }
        }
        .line1{
            transform: rotate(-45deg) translate(-9px, 6px);
        }
        .line2{
            opacity: 0;
        }
        .line3{
            transform: rotate(45deg) translate(-8px, -8px);
        }
    }
    .nav-fixed {
        height: 10vh;
        position: fixed;
        top: 0;
        left: 0;
        .nav-links{
            top: 10vh;
        }
    }

@include media($desktop) {
    nav {
        display: flex;
        flex-direction: row;
        align-items: space-between;
        justify-content: space-between;
        height: 15vh;
        img {
            z-index: 99;
            height: 10vh;
        }
        .nav-links {
            pointer-events: auto;
            position: static;
            flex-direction: row;
            align-items: center;
            justify-content: flex-end; 
            a {
                opacity: 1;
                width: 15vw;
            }
        }
    }

    .burger {
        display: none;
    }
    
    
}

sources.styles\\_home.scss:
#home-title {
    height: 90vh;
    background-image: url(/images/burger-mob.jpg);
    @include media($desktop) {
        background-image: url(/images/burger-desktop.jpg);
    }
    background-repeat: no-repeat no-repeat;
    background-size: cover;
    background-position: center;
    padding: 1em;
    @include flexCenter(row);  
}

sources.styles\\_about.scss:
#about-page {
    height: 90vh;
    .about-image{
        display: none;
    }
    .about-content{
        padding: 10vh;
        @include flexCenter(column);
        div {
            @include flexCenter(row);
            width: 100vw;
            padding: 2em;
        }
    }
}

@media only screen and (min-width: 720px) {
#about-page {
    @include flexCenter(row);
    .about-image {
        display: block; 
        width: 50vw;
        height: 90vh;
        background-image: url(../images/waitress.jpg);
        background-repeat: no-repeat no-repeat;
        background-size: cover;
        background-position: center;   
    }
    .about-content {
        width: 50vw;
        height: 90vh;
        div {
            width: 40vw;
        }
    }
}
}

sources.styles\\_menu.scss:
#menu-title {
    @extend #home-title;
    flex-direction: column;
    h2 {
        height: 100vh;
        display: block;
        @include flexCenter(row);
    }
    .arrow {
        height: 10vh;
        text-decoration: none; 
        color: $green;
        &:hover{
            color: $darkGreen;
        }
    }
}

#menu-content {
    height: auto;
    min-height: 90vh;
    .menu-nav {
        min-height: 25vh;
        display: grid;
        grid-template-columns: repeat(auto-fit, minmax(150px, 1fr));
        @include media(450px){
            grid-template-columns: repeat(auto-fit, minmax(200px, 1fr));
        }
        @include media(600px){
            grid-template-columns: repeat(auto-fit, minmax(150px, 1fr));
        }
        align-items: center;
        justify-content: space-around;
        button {
            font-family: 'Slabo 27px', serif;
            height: 15vh;
            flex: 1;
            margin: 1vw;
            @media (min-width: 720px) {
                padding: 1em;
                margin: 0 1em;
            }
            border-style: none;
            background: $green;
            cursor: pointer;
            &:hover {
                background: $darkGreen;
            }
        }
    }  
    .menu-container {
        width: 100vw;
        transition: opacity 0.6s ease;
        padding: 1em;
        min-height: 65vh;
        .menu-list {
            padding: 2vh 1vw;
            @include media($tablet){
                display: grid;
                grid-template-columns: repeat(2, 1fr);
                grid-gap: 10px
            }
        }
    }
}

sources.styles\\_review.scss:
#reviews {
    @extend #home-title;
    background:linear-gradient(to bottom, rgba(0, 0, 0, 0.5) 0%, rgba(0, 0, 0, 0.5) 100%), url(/images/burger-mob.jpg);
    background-repeat: no-repeat no-repeat;
    background-size: cover;
    background-position: center;
    @include media($desktop) {
        background-image: linear-gradient(to bottom, rgba(0, 0, 0, 0.5) 0%, rgba(0, 0, 0, 0.5) 100%), url(/images/burger-desktop.jpg);
    }
    @include flexCenter(column);    
    h2 {
        height: 10vh;
    }
 
    //dot in index
   
    .review-container {
        height: 60vh;
        width: 100vw;
        position: relative;
        .review-item {
            opacity: 0;
            &:nth-child(1) {opacity: 1};
            height: 60vh;
            width: 100vw;
            position: absolute;
            display: flex;
            flex-direction: column;
            align-items: center;
            justify-content: center;
            transition: opacity 0.6s ease;
            .review-text {
                width: 50vw;
            }
        }
    }    
}

sources.styles\\_location.scss:
#location {
    height: auto;
    min-height: 90vh;
    @include media($tablet){
        height: 90vh;
    };
    padding: 1em;
    @include flexCenter(column);
    h2 {
        height: 10vh;
    }
    .location-container{
        width: 100vw;
        height: 65vh;
        position: relative;
        .location-item {
            position: absolute;
            width: 100vw;
            display: flex;
            flex-direction: column;
            align-items: center;
            justify-content: space-around;
            opacity: 0;
            pointer-events: none;
            &:nth-child(1) {opacity: 1; pointer-events: auto}
            button {
                font-family: 'Slabo 27px';
                margin: 1vh;
                padding: 1em;
                border-style: none;
                background: $green;
                cursor: pointer;
                &:hover {
                    background: $darkGreen;
                }
            }
            .contact {
                a {
                    text-decoration: none;
                    color: white;
                }
                p:hover {
                    color: $green;
                }
            }
        }
    } 
    //dot in index
}

// icons 

@include media($tablet) {
    .swipe {
        display: none;
    }
}

sources.styles\\_footer.scss:
#footer {
    margin-top: 5vh;
    scroll-snap-align: center;
    width: 100vw;
    padding: 1vh 1vw;
    li {
        line-height: 3;
        list-style: none;
        a {
            text-decoration: none;
            color: $white;
            &:hover {
                color: $green;
            }
        }
       
        img {
            cursor: pointer;
            width: 45px;
            &:hover {
                opacity: 0.7;
            }
            display: block;
        }
    }
    img {
        max-width: 100%;
        padding: 1vh 0;
        margin: auto;
    }
    @include media($desktop){
        text-align: left;
        display: grid;
        grid-template-columns: repeat(4, 1fr);
        grid-gap: 3vw;
        font-size: smaller;
        li {
            line-height: inherit;
            img {
                display: inline;
                margin-right: 5px;
            }
        }
    }
}

